import "./topbar.scss";
import { useState } from 'react';
import React from "react";
//import {Person} from "@material-ui";



class Topbar extends React.Component {
  constructor() {
    super();

    this.state = {
      sandwich: false,
    };
  }

  handleClick = () => {
      this.setState({
        sandwich: true
      })
      console.log("1")
  };

  render() {
    let temp = "topbar"
    if (this.sandwich === 'true') {
      temp += " active"
    }
    console.log(temp)
    return (
      <div className={temp}>
      <div className="wrapper">
        <p className="gauche">
          <a href="#" className="logo">
            Anthony Bauchet
          </a>
          <div className="itemContainer">
          <p>dlso.mesgrossescouilles.fr</p>
        </div>
        <div className="itemContainer">
          <p>06 6666666666</p>
        </div>
        </p>
        

        <p className="droite">
          <div className="sandwich" >
            <span className="line1"></span>
            <span className="line2"></span>
            <span className="line3"></span>
          </div>
          <button onClick={this.state.handleClick}></button>
        </p>
      </div>
    </div>
    );
  }
}

export default Topbar;

